import React, { Component } from 'react'
import { Navbar } from 'react-bootstrap';

export default class bar extends Component {
   
    render() {
        return (
            <Navbar bg="dark" variant="dark">
            <Navbar.Brand href="#home">Navbar</Navbar.Brand>
           
          </Navbar>
        )
    }
}
